// eslint-disable-next-line
import React, { Component, Img } from 'react';
// eslint-disable-next-line
import { BrowserRouter as Router, Route, Link, Switch, Redirect } from 'react-router-dom';
// eslint-disable-next-line
import { Card, Badge, Row, Col, Button, Menu, Icon, Layout, Avatar} from 'antd';
// partials
// eslint-disable-next-line
// css
import './App.css';
import 'antd/dist/antd.css';
// eslint-disable-next-line

function ListRow (props) {
  props.items.forEach(item => {
    return (
      <li>{item}</li>
    )
  })
}

class App extends Component {
  constructor (props) {
    super(Component)
    props.items = ['Joey', 'Kyle']
  }
  render() {
    return (
      <div className="App">
        <Layout>
          <Col rows={8}>
            <ul>
              <ListRow items={this.props.items}/>
            </ul>
          </Col>
        </Layout>
      </div>
    );
  }
}

export default App;
